import React from 'react';
import ReactPlayer from 'react-player';

const VideoQueue = ( {videoNames} ) => {

	const videoComp = (videoNames || []).map((user, i) => {
		return <li>{videoNames[i]}</li>
	})

	return(

		<div>
			{videoComp}
		</div>
	);
}

export default VideoQueue;
